import React, { Component } from 'react';
import './App.css';
import { Nav, Navbar } from 'react-bootstrap';
import Visualizacao from './visualizacao';
import { Route, BrowserRouter,Link, Switch } from "react-router-dom";
import Cadastro from './cadastro';
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
    }
  }
  render() {
    return (
      <div className="App">
        <Navbar bg="dark" variant="dark" expand="lg">
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
              <Nav.Link href="#visualizacao"><Link to="/">Visualizacao</Link></Nav.Link>
              <Nav.Link href="#cadastro"><Link to="/cadastro">Visualizacao</Link></Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
        <br />
        <BrowserRouter>
          <Switch>
            <Route path="/" component={Visualizacao} exact = {true}/>
            <Route path="/cadastro" component={Cadastro} />
          </Switch>
        </BrowserRouter>

      </div >
    );
  }
}
export default App;
